import React from 'react';
import {
	Link
} from 'react-router-dom';

const Navigation = () => {
	return ( <
		div className = "menu d-none" >
		<
		Link to = "/about-me"
		className = "menu-left" >
		O mnie <
		/Link>

		<
		Link to = "/portfolio"
		className = "menu-center" >
		Portfolio <
		/Link>

		<
		Link to = "/contact"
		className = "menu-right" >
		Kontakt <
		/Link> <
		/div>
	);
};

export default Navigation;
